        height:"30px",
        width :"30px"
}


export default function Counter()
{
    return(<div className="counter">
                <span className="count" style={{countStyle}}>0</span>
                <div>
                    <button className="increment"  style={{fontSize:"30px"}} onClick={increment1}>+1</button>  
                </div>
          </div>
    )
}

function increment1()
{
    console.log("incrementd plus 1")
}
